public IneqMesh GetIneqMesh()
{
    return new IneqMesh
    {
        X0 = -1.0,
        Y0 = -1.0,
        Z0 = -1.0,
        X1 = 1.0,
        Y1 = 1.0,
        Z1 = 1.0,
        D = 0.1d,
        Boxed = false,
        IneqTree =
          (
            (# abs(x) - 0.6) &
            (# abs(y) - 0.6) &
            (# abs(z) - 0.6)
          )
          | (# x * x + y * y + z * z - 0.5)
      };
}
